INSERT INTO t_input_column VALUES (1338,'EntityId','c1','\n				EntityId\n				\n				','String','DATA',101);
INSERT INTO t_input_column VALUES (1339,'Date','c2','\n				EntityId\n				\n				','String','DATA',101);
INSERT INTO t_input_column VALUES (1340,'siteId','c0','\n				-	GK site ID in AFDB_BTG-SITES_D-<YYMMDD>-TopTalkers.txt\n-	empty field in \"AFDB_BTG-NETWORK_*-TopTalkers.txt\"\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1341,'phoneNumber','c1','\n				Phone number\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1342,'direction','c2','\n				Direction of traffic from the phone\'s point of view: either \"In\" (Incoming traffic) or \"Out\" (Outgoing traffic).\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1343,'subset','c3','\n				Main subset of traffic (example : onNet)\nNote: the main subset of traffic is first part of the AFDB call type defined in \"afdbCallTypesForGkCdr.txt\". For example, the main subset of traffic for the subset \"onNet_SAN-SA\" is onNet.\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1344,'callRate','c4','\n				Call rate compared to the total number of calls on the network for this direction and this traffic subset. This rate (between 0 and 100) is given with 2 decimals, except in the case where it is equal to 100.\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1345,'numberOfCalls','c5','\n				Number of calls\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1346,'durationOfCalls','c6','\n				Duration of phone calls\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1347,'numberOfSuccessfulCalls','c7','\n				Number of phone calls that resulted in communication between the caller and the called party.\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1348,'numberOfAcceptedCalls','c8','\n				Number of phone calls said to be \"accepted\" (called party busy, called party does not answer, ...)\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1349,'numberOfRejectedCalls','c9','\n				Number of rejected phone calls.\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1350,'numberOfFailedCalls','c10','\n				Number of phone calls that have failed.\n				\n				','String','DATA',102);
INSERT INTO t_input_column VALUES (1351,'siteId','c0','\n				Site Identifier.\nThis field can be used to select the aggregations by sub-customer.\nThis identifier must be used to retrieve the site name provided in configuration (this allows to immediately take into account a renaming of site).\nExample: 1934.\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1352,'element','c1','\n				Description for customer statistics:\nElement concerned by these aggregations. \nThis field can be empty (which means that the aggregations are concerning the whole site), or contain a value. Depending on the context, this value can be a name (ex: name of OPM), an identifier (ex: destination siteId).\nDescription for global statistics (and for all the BTG meta-customers):\nThis field is always empty (no site to site statistics)\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1353,'direction','c2','\n				Direction of traffic, used only to describe the traffic by site (files *SiteVolumes.txt). This field can be empty (to represent any direction). The others possible values are \"In\" (Incoming traffic) or \"Out\" (Outgoing traffic).\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1354,'subset','c3','\n				Description for customer statistics:\nSubset of traffic identified by an \"AFDB call type\" (ex: \"offNet\"). \nThis field can be empty. In this case, the aggregations are concerning the total traffic (always provided if we have measurements for this period)\nWhen the AFDB configuration doesn\'t allow identifying a traffic subset, the default value of this field is the GK CDR call type.\nDescription for global statistics (and for all the BTG meta-customers):\nThis field is always empty (no distinction of traffic subset)\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1355,'telephonyZone','c4','\n				Description for customer statistics:\nName of telephony zone (ex: \"CHINA-GUANGDONG\"). This field can be empty (which means that the aggregation is done without distinction of telephony zone).\nDescription for global statistics (and for all the BTG meta-customers):\nThis field is always empty (no distinction of telephony zone).\n\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1356,'prefix','c5','\n				Prefix of phone number. This field can be empty\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1357,'numberOfCalls','c6','\n				Number of calls\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1358,'durationOfCalls','c7','\n				Duration of phone calls\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1359,'numberOfSuccessfulCalls','c8','\n				Number of phone calls that resulted in communication between the caller and the called party.\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1360,'numberOfAcceptedCalls','c9','\n				Number of phone calls said to be \"accepted\" (called party busy, called party does not answer, ...)\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1361,'numberOfRejectedCalls','c10','\n				Number of rejected phone calls.\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1362,'numberOfFailedCalls','c11','\n				Number of phone calls that have failed.\n				\n				','String','DATA',103);
INSERT INTO t_input_column VALUES (1363,'element','c0','\nAlways empty in AFDB_BTIC-NETWORK* statistics.\nSite Identifier in AFDB_BTIC-SITES_*-Volumes.txt statistics.\nGU identifier in AFDB_BTIC-GU_*-Volumes.txt statistics.\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1364,'InterElement','c1','\nAlways empty in AFDB_BTIC-NETWORK_*-Volumes.txt \nEmpty or destination site identifier for inter/intra sites statistics \nEmpty or destination GU identifier for inter GU statistics.\nSite identifier for GU-Site statistics (not in the scope of this item)\n\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1365,'direction','c2','\n				Direction of traffic, used only to describe the traffic by site (files *SiteVolumes.txt). This field can be empty (to represent any direction). The others possible values are \"In\" (Incoming traffic) or \"Out\" (Outgoing traffic).\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1366,'subset','c3','\n				Description for customer statistics:\nSubset of traffic identified by an \"AFDB call type\" (ex: \"offNet\"). \nThis field can be empty. In this case, the aggregations are concerning the total traffic (always provided if we have measurements for this period)\nWhen the AFDB configuration doesn\'t allow identifying a traffic subset, the default value of this field is the GK CDR call type.\nDescription for global statistics (and for all the BTG meta-customers):\nThis field is always empty (no distinction of traffic subset)\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1367,'telephonyZone','c4','\n				Description for customer statistics:\nName of telephony zone (ex: \"CHINA-GUANGDONG\"). This field can be empty (which means that the aggregation is done without distinction of telephony zone).\nDescription for global statistics (and for all the BTG meta-customers):\nThis field is always empty (no distinction of telephony zone).\n\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1368,'prefix','c5','\n				Prefix of phone number. This field can be empty\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1369,'numberOfCalls','c6','\n				Number of calls\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1370,'durationOfCalls','c7','\n				Duration of phone calls\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1371,'numberOfSuccessfulCalls','c8','\n				Number of phone calls that resulted in communication between the caller and the called party.\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1372,'numberOfAcceptedCalls','c9','\n				Number of phone calls said to be \"accepted\" (called party busy, called party does not answer, ...)\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1373,'numberOfRejectedCalls','c10','\n				Number of rejected phone calls.\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1374,'numberOfFailedCalls','c11','\n				Number of phone calls that have failed.\n				\n				','String','DATA',104);
INSERT INTO t_input_column VALUES (1375,'element','c0','\n				Identifier of element concerned by this line of statistics.\n- Name of \"IPBX zone\" if the file provide statistics on \"IPBX zones\".\n- SARE reference if the element is a device (IPBX, \"voice gateway\", \"media gateway\", \"third party server\"). Example: \"TL4US.X.VGDLS\".\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1376,'maxNumberOfOccupiedChannelsDuringTheBusyHour','c1','\n				Max number of channels simultaneously occupied during the busy hour. \n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1377,'durationOfTheMaxOccupancyDuringTheBusyHour','c2','\n				Duration of the max occupancy during the busy hour.\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1378,'reservedField1','c3','\n				Reserved field\nNote: By symmetry with what is done for other statistics, could be used later to store the max number of channels which can be used during the busy day.\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1379,'busyDay','c4','\n				Day of the first peak of occupied channels.\nThe format of this field is YYYY-MM-DD (example of value: \"2008-01-14\").\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1380,'busyHour','c5','\n				Hour of the (first) peak of occupied channels.\nThe format of this field is hh:mm:ss (example of value: \"16:04:55\").\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1381,'trafficCarriedDuringTheBusyHour','c6','\n				Traffic carried during the busy hour, in \"centum call seconds\" (CCS). It is the total amount of traffic (in seconds) divided by 100.\n1 CCS is equal to 100 call*second (ex: the traffic carried by 2 calls of 51 seconds is equal to 1.02 CCS). \n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1382,'reservedField2','c7','\n				Reserved field \nNote: By symmetry with what is done for other statistics, could be used later to store the number of channels to add in order to avoid any blocking of call during the busy hour.\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1383,'reservedField3','c8','\n				Reserved field \nNote: By symmetry with what is done for other statistics, could be used later to store the probability (in %) that a new call be blocked during the busy hour because of the channels occupancy. This indicator is also known as the GoS (Grade of Service).\n				\n				','String','DATA',105);
INSERT INTO t_input_column VALUES (1384,'periodNumber','c0','\n				Number of elementary period in the day. This number starts from 0.\nFor example, if the duration of elementary period specified in the name of the file is 1800 seconds, then the elementary period number is in the interval [0, 47].\n				\n				','int','DATA',106);
INSERT INTO t_input_column VALUES (1385,'averageNumberOfConcurrentCalls','c1','\n				Average number of simultaneous conversations during the elementary period. Simultaneity is evaluated per second. Conversations taken into account are those that started during the day.\n				\n				','String','DATA',106);
INSERT INTO t_input_column VALUES (1386,'maxNumberOfConcurrentCalls','c2','\n				Maximum number of simultaneous conversations during the elementary period. \n				\n				','String','DATA',106);
INSERT INTO t_input_column VALUES (1387,'dateOfMax','c3','\n				Date of the first peak of simultaneous conversations. \nThe format of this date is : YYYY-MM-DD hh:mm:ss\nExample: \"2006-10-02 10:18:05\"\n				\n				','String','DATA',106);
INSERT INTO t_input_column VALUES (1388,'periodNumber','c0','\n				Time slot number\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1389,'','c1','\n				Reserved field (empty).\n				\n				','void','DATA',107);
INSERT INTO t_input_column VALUES (1390,'subset','c2','\n				Traffic sub-set.  The possible values of this field are :  \n-	total	 	 (total traffic, always provided if there are measurements in the period)\n-	onNet	 (\"on-net\" traffic)\n-	onNetIn	 (incoming \"on-net\" traffic)\n-	onNetOut	 (outgoing \"on-net\" traffic)\n-	intOnNetIn	 (incoming \"internal on-net\" traffic)\n-	intOnNetOut	 (outgoing \"internal on-net\" traffic)\n-	extOnNetIn	 (incoming \"external on-net\" traffic)\n-	extOnNetOut	 (outgoing \"external on-net\" traffic)\n-	offNet	 (\"off-net\" traffic)\n-	offNetIn	 (incoming \"off-net\" traffic)\n-	offNetOut	 (outgoing \"off-net\" traffic)\nRemark : \nOther values could be defined in later versions. In order to limit the constraints on the order of software updates, an application that uses this field should ignore the values that it does not know (an unknown value should not trigger any error).\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1391,'','c3','\n				Reserved field (empty).\n				\n				','void','DATA',107);
INSERT INTO t_input_column VALUES (1392,'reliability','c4','\n				Reliability of the aggregations. This is also the completeness ratio of the measurements.\nThe value of this field is a real number between  0 and 100.\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1393,'numberOfCalls','c5','\n				Number of phone calls\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1394,'numberOfCallsTakenIntoAccount','c6','\n				Number of phone calls taken into account (calls without CMR or with inconsistent latency are not recorded here).\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1395,'numberOfCmrTakenIntoAccount','c7','\n				Number of CMR taken into account (these are CMRs for calls taken into account).\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1396,'numberOfPackets','c8','\n				Number of IP packets transmitted.\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1397,'sumOfLatencies','c9','\n				Cumulative of the latencies.\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1398,'sumOfJitters','c10','\n				Cumulative of the jitters.\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1399,'numberOfLostPackets','c11','\n				Number of lost packets.\n				\n				','String','DATA',107);
INSERT INTO t_input_column VALUES (1400,'sourceSite','c0','\n				Name of the source site (phone entity of type site), \"Unknown\" by default.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1401,'destinationSite','c1','\n				Name of the destination site (phone entity of type site), \"Unknown\" by default.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1402,'subset','c2','\n				Traffic subset. The possible values are : onNet, extOnNet, offNet.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1403,'compression','c3','\n				Compression. The possible values are G711, G729.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1404,'numberOfCalls','c4','\n				number of calls (just for diag, no relation with QoS statistics)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1405,'numberOfSuccessfulCalls','c5','\n				number of successful calls (just for diag, no relation with QoS statistics)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1406,'numberOfCallsTakenIntoAccountForQos','c6','\n				Number of phone calls taken into account (calls without CMR or with inconsistent latency are not recorded here).\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1407,'numberOfCmrTakenIntoAccount','c7','\n				Number of CMR taken into account (CMRs for the calls taken into account).\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1408,'numberOfPackets','c8','\n				Number of IP packets transmitted.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1409,'sumOfLatencies','c9','\n				Sum of latencies.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1410,'sumOfJitters','c10','\n				Sum of jitters.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1411,'numberOfLostPackets','c11','\n				Number of lost packets.\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1412,'numberOfCallsInLowRangeOfMos','c12','\n				Number of calls with a MOS value in range [ 1, MOS_THRESHOLD_1 [\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1413,'numberOfCallsInMediumRangeOfMos','c13','\n				Number of calls with a MOS value in [ MOS_THRESHOLD_1, MOS_THRESHOLD_2 ]\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1414,'numberOfCallsInHighRangeOfMos','c14','\n				Number of calls with a MOS value in range ] MOS_THRESHOLD_2, 5 ]\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1415,'averageMos','c15','\n				Average MOS (decimal number rounded to 1 fractional digit).\nExample: 4.1\nEmpty if no phone calls could be taken into account (i.e. field numberOfCallsTakenIntoAccountForQos is equal to 0)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1416,'highestValueOfMos','c16','\n				Highest value of MOS (decimal number rounded to 2 fractional digits).\nExample: 4.11\nEmpty if no phone calls could be taken into account (i.e. field numberOfCallsTakenIntoAccountForQos is equal to 0)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1417,'timeOfHighestValueOfMos','c17','\n				Time of the highest value of MOS (format YYYY-MM-DD hh:mm:ss)\nThis date is the start date of the corresponding call.\nEmpty if no phone calls could be taken into account (i.e. field numberOfCallsTakenIntoAccountForQos is equal to 0)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1418,'lowestValueOfMos','c18','\n				Lowest value of MOS (decimal number rounded to 2 fractional digits).\nExample: 4.11\nEmpty if no phone calls could be taken into account (i.e. field numberOfCallsTakenIntoAccountForQos is equal to 0)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1419,'timeOfLowestValueOfMos','c19','\n				Time of the lowest value of MOS (format YYYY-MM-DD hh:mm:ss)\nThis date is the start date of the corresponding call.\nEmpty if no phone calls could be taken into account (i.e. field numberOfCallsTakenIntoAccountForQos is equal to 0)\n				\n				','String','DATA',108);
INSERT INTO t_input_column VALUES (1420,'periodNumber ','c0','\n				Time slot number:\n-	value in the interval [0, 287] for the aggregations by elementary period of 5 mn, value in the interval [0, 47] for the aggregations per 30 min period\n-	value in the interval [0, 23] for the hourly aggregations (hour of the day).\n-	value in the interval [1, 31] for the daily aggregations (day of the month).\n-	value in the interval [1, 12] for the monthly aggregations (month of the year).\n				\n				','int','DATA',109);
INSERT INTO t_input_column VALUES (1421,'','c1','\n				reserved field (empty)\n				\n				','void','DATA',109);
INSERT INTO t_input_column VALUES (1422,'subset','c2','\n				Traffic sub-set.  The possible values of this field are :  \n-	total	 	 (total traffic, always provided if there are measurements in the period)\n-	onNet	 (\"on-net\" traffic)\n-	onNetIn	 (incoming \"on-net\" traffic)\n-	onNetOut	 (outgoing \"on-net\" traffic)\n-	intOnNetIn	 (incoming \"internal on-net\" traffic)\n-	intOnNetOut	 (outgoing \"internal on-net\" traffic)\n-	extOnNetIn	 (incoming \"external on-net\" traffic)\n-	extOnNetOut	 (outgoing \"external on-net\" traffic)\n-	offNet	 (\"off-net\" traffic)\n-	offNetIn	 (incoming \"off-net\" traffic)\n-	offNetOut	 (outgoing \"off-net\" traffic)\nRemark : \nOther values could be defined in later versions. In order to limit the constraints on the order of software updates, an application that uses this field should ignore the values that it does not know (an unknown value should not trigger any error).\n				\n				','String','DATA',109);
INSERT INTO t_input_column VALUES (1423,'','c3','\n				reserved field (empty)\n				\n				','void','DATA',109);
INSERT INTO t_input_column VALUES (1424,'reliability','c4','\n				Reliability of the aggregations. This is also the completeness ratio of the measurements.\nThe value of this field is a real number between 0 and 100.\n				\n				','String','DATA',109);
