INSERT INTO t_input_column VALUES (1427,'numberOfSuccessfulCalls','c7','\n				Number of phone calls that resulted in communication between the caller and the called party.\n				\n				','String','DATA',109);
INSERT INTO t_input_column VALUES (1428,'numberOfAcceptedCalls','c8','\n				Number of phone calls said to be \"accepted\" (called party busy, called party does not answer, ...)\n				\n				','String','DATA',109);
INSERT INTO t_input_column VALUES (1429,'numberOfRejectedCalls','c9','\n				Number of rejected phone calls.\n				\n				','String','DATA',109);
